import React from 'react';

import './navigator.css';

const Navigator = () => {
  return (
    <div className='navigator'>
      <div>
        <a href="/movies">Movies</a>
        <a href="/series">Series</a>
        <a href="#t">Cartoons</a>
        <a href="#t">Anime</a>
      </div>
      <div>
        <a href="/history">history</a>
        <a href="#t">808TNMYP808</a>
      </div>
    </div>
  );
};

export default Navigator;
